window.bookSummaryJSON = "<p><b>A brand-new comedy starring Taraji P. Henson and Tracee Ellis Ross.</b></p> <p>Separated by 10 years, 3,000 miles, and the unrelenting stresses of adulthood, best friends Janet and Serena plan a 40th birthday girls’ trip to reconnect. But after a massive crash, they’re the only survivors to wash ashore on an uncharted Caribbean Island.</p> <p>Armed with only the clothes on their backs and zero survival skills, they fight to overcome hunger, thirst, deadly wildlife—and most terrifyingly—decades of accrued resentment. Can they find their way home, or will they kill each other first?</p> <p>Stranded is a comedy about survival, friendship, and surviving your friendship, with an all-star cast including Taraji P. Henson, Tracee Ellis Ross, Blake Griffin, Whoopi Goldberg, Taye Diggs, Zazie Beetz, Nicole Byer, Tim Robinson, Keith David, Mikey Day, Ashley Nicole Black, Larry Wilmore, and Phylicia Rashad.</p> <p><b>Please note: This show is for mature audiences only. It contains explicit language, sexual references, and adult themes. Discretion is advised.</b></p>"; 
